
<!DOCTYPE html>
<html lang="sk">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Pomenovanie obrázkov</title>
    <style>
        body { font-family: 'Segoe UI', sans-serif; background: #f9f9f9; padding: 20px; color: #333; }
        .container { max-width: 1000px; margin: 0 auto; background: white; padding: 30px; border-radius: 8px; box-shadow: 0 4px 15px rgba(0,0,0,0.1); }
        h1 { color: #2563eb; margin-bottom: 5px; }
        .meta { color: #666; font-size: 0.9em; margin-bottom: 20px; }
        .instructions { background: #e0f2fe; border-left: 4px solid #2563eb; padding: 15px; margin-bottom: 20px; }
        
        .layout { display: flex; flex-wrap: wrap; gap: 30px; }
        .sidebar { flex: 1; min-width: 250px; }
        .game-area { flex: 2; min-width: 300px; }

        .term-btn { 
            display: flex; justify-content: space-between; align-items: center;
            width: 100%; padding: 12px; margin-bottom: 8px; 
            background: white; border: 1px solid #d1d5db; border-radius: 6px; 
            cursor: pointer; text-align: left; transition: 0.2s; font-size: 1em;
        }
        .term-btn:hover { background: #f3f4f6; }
        .term-btn.active { background: #2563eb; color: white; border-color: #2563eb; }
        .term-btn.answered { border-left: 5px solid #9ca3af; background: #f9fafb; color: #6b7280; }
        
        .status-icon { font-weight: bold; font-size: 1.2em; }
        .status-correct { color: #16a34a; }
        .status-wrong { color: #dc2626; }

        .image-wrapper { position: relative; display: inline-block; width: 100%; }
        #game-image { width: 100%; height: auto; display: block; cursor: crosshair; user-select: none; }
        
        .click-marker {
            position: absolute; width: 14px; height: 14px; background: rgba(37, 99, 235, 0.8);
            border: 2px solid white; border-radius: 50%; transform: translate(-50%, -50%);
            pointer-events: none; box-shadow: 0 0 5px rgba(0,0,0,0.5);
        }

        .results-box { margin-top: 30px; border-top: 2px solid #eee; padding-top: 20px; }
        .btn-eval { background: #16a34a; color: white; border: none; padding: 12px 24px; font-size: 1.1em; border-radius: 5px; cursor: pointer; width: 100%; margin-top: 20px; }
        .btn-eval:hover { background: #15803d; }
        .btn-detail { background: #4b5563; color: white; border: none; padding: 10px 20px; border-radius: 4px; cursor: pointer; margin-top: 10px; }

        @media print {
            .no-print { display: none; }
        }
    </style>
</head>
<body>
    <div class="container">
        <h1>Pomenovanie obrázkov</h1>
        <div class="meta">Autor: Mgr. Erika Matyiová</div>
        
        <div class="input-group" style="margin-bottom: 20px;">
            <label><strong>Meno žiaka:</strong></label>
            <input type="text" id="studentName" style="padding: 8px; font-size: 1em; width: 250px;" placeholder="Zadaj svoje meno">
        </div>

        <div class="instructions">
            <strong>Pokyny:</strong> Klikni na pojem na následne na správne miesto na obrázku.
            <br><small>Označ pojem v zozname a následne klikni na príslušné miesto na obrázku.</small>
        </div>

        <div class="layout">
            <div class="sidebar">
                <h3>Pojmy</h3>
                <div id="terms-list"></div>
                <button onclick="evaluateExercise()" class="btn-eval" id="btnEval">Vyhodnotiť</button>
            </div>

        let terms = [...data.points];
        let userAnswers = {}; 
        let selectedTermId = null;
        let isEvaluated = false;

        function init() {
            for (let i = terms.length - 1; i > 0; i--) {
                const j = Math.floor(Math.random() * (i + 1));
                [terms[i], terms[j]] = [terms[j], terms[i]];
            }
            renderTerms();
        }

        function renderTerms() {
            const list = document.getElementById('terms-list');
            list.innerHTML = '';
            terms.forEach(t => {
                const btn = document.createElement('div');
                btn.className = 'term-btn';
                btn.innerHTML = '<span>' + t.term + '</span> <span class="status-icon" id="status-'+t.id+'"></span>';
                btn.dataset.id = t.id;
                btn.onclick = () => selectTerm(t.id);
                list.appendChild(btn);
            });
        }

        function selectTerm(id) {
            if(isEvaluated) return;
            selectedTermId = id;
            document.querySelectorAll('.term-btn').forEach(b => b.classList.remove('active'));
            const activeBtn = document.querySelector('.term-btn[data-id="'+id+'"]');
            if(activeBtn) activeBtn.classList.add('active');
        }

        document.getElementById('imgWrapper').addEventListener('click', function(e) {
            if(isEvaluated || !selectedTermId) return;
            if(e.target.tagName !== 'IMG' && !e.target.classList.contains('click-marker')) return;

            const rect = this.getBoundingClientRect();
            const x = e.clientX - rect.left;
            const y = e.clientY - rect.top;
            const xPerc = (x / rect.width) * 100;
            const yPerc = (y / rect.height) * 100;

            userAnswers[selectedTermId] = { x: xPerc, y: yPerc };

            const existing = document.getElementById('marker-'+selectedTermId);
            if(existing) existing.remove();

            const marker = document.createElement('div');
            marker.className = 'click-marker';
            marker.id = 'marker-'+selectedTermId;
            marker.style.left = xPerc + '%';
            marker.style.top = yPerc + '%';
            this.appendChild(marker);

            const btn = document.querySelector('.term-btn[data-id="'+selectedTermId+'"]');
            btn.classList.add('answered');
            btn.classList.remove('active');
            selectedTermId = null;
        });

        function evaluateExercise() {
            if(isEvaluated) return;
            const name = document.getElementById('studentName').value.trim();
            if(!name) { alert('Prosím, vyplň svoje meno.'); return; }

            isEvaluated = true;
            let score = 0;

            terms.forEach(t => {
                const ans = userAnswers[t.id];
                let isCorrect = false;

                if (ans) {
                    const dx = ans.x - t.x;
                    const dy = ans.y - t.y;
                    
                    if (t.shape === 'circle') {
                        // Kruh: Euklidovska vzdialenost
                        const dist = Math.sqrt(dx*dx + dy*dy);
                        if (dist <= t.radius) isCorrect = true;
                    } else {
                        // Štvorec / Obdĺžnik: Box check
                        // Polomer berieme ako polovicu sirky v % pre X
                        // Pre Y je to zlozitejsie kvoli pomeru stran, 
                        // ale pre zjednodusenie pouzijeme polomer aj pre Y toleranciu (v % vysky)
                        // To znamena, ze ak je obrazok sirokouhly, "štvorec" tolerancie bude obdlznikovy
                        // Ale je to konzistentne s vizualnym zobrazenim v editore ak pouzijeme padding-top hack.
                        
                        // Zjednodušená logika pre hitboxy:
                        // Ak je to štvorec/kocka, tolerujeme rozdiel v X a Y menší ako rádius.
                        if (Math.abs(dx) <= t.radius && Math.abs(dy) <= t.radius) {
                             isCorrect = true;
                        }
                    }
                }

                if(isCorrect) score++;

                const statusSpan = document.getElementById('status-'+t.id);
                if(isCorrect) {
                    statusSpan.innerHTML = '&#10004;';
                    statusSpan.classList.add('status-correct');
                } else {
                    statusSpan.innerHTML = '&#10008;';
                    statusSpan.classList.add('status-wrong');
                }
            });

            const total = terms.length;
            const perc = total > 0 ? Math.round((score / total) * 100) : 0;
            const now = new Date().toLocaleString('sk-SK');

            document.getElementById('resName').innerText = name;
            document.getElementById('resScore').innerText = score;
            document.getElementById('resTotal').innerText = total;
            document.getElementById('resPerc').innerText = perc;
            document.getElementById('resTime').innerText = now;
            
            document.getElementById('summary').style.display = 'block';
            document.getElementById('btnEval').style.display = 'none';
            document.getElementById('studentName').disabled = true;
            document.querySelectorAll('.term-btn').forEach(b => b.style.cursor = 'default');
        }

        function showDetails() {
            const name = document.getElementById('studentName').value;
            const score = document.getElementById('resScore').innerText;
            const total = document.getElementById('resTotal').innerText;
            const perc = document.getElementById('resPerc').innerText;
            const time = document.getElementById('resTime').innerText;

            let rows = '';
            
            terms.forEach(t => {
                const ans = userAnswers[t.id];
                let isCorrect = false;
                if (ans) {
                    const dx = ans.x - t.x;
                    const dy = ans.y - t.y;
                    if (t.shape === 'circle') {
                        if (Math.sqrt(dx*dx + dy*dy) <= t.radius) isCorrect = true;
                    } else {
                        if (Math.abs(dx) <= t.radius && Math.abs(dy) <= t.radius) isCorrect = true;
                    }
                }
                
                const symbol = isCorrect ? '<span style="color:green; font-weight:bold">&#10004;</span>' : '<span style="color:red; font-weight:bold">&#10008;</span>';
                
                rows += `<tr>
                    <td style="padding:8px; border:1px solid #ddd">${t.term}</td>
                    <td style="padding:8px; border:1px solid #ddd; text-align:center">${ans ? 'Označené' : 'Neoznačené'}</td>
                    <td style="padding:8px; border:1px solid #ddd; text-align:center">${symbol}</td>
                </tr>`;
            });

            const win = window.open('', '_blank', 'width=800,height=600');
            win.document.write(`
                <html>
                <head>
                    <title>Detailné výsledky - ${name}</title>
                    <style>
                        body { font-family: sans-serif; padding: 30px; }
                        h1 { color: #2563eb; }
                        table { width: 100%; border-collapse: collapse; margin-top: 20px; }
                        th { background: #f3f4f6; text-align: left; padding: 10px; border: 1px solid #ddd; }
                        .legend { margin-top: 20px; font-size: 0.9em; color: #555; border-top: 1px solid #eee; padding-top: 10px; }
                        @media print { .no-print { display: none; } }
                    </style>
                </head>
                <body>
                    <h1>Detailný prehľad výsledkov</h1>
                    <p><strong>Názov cvičenia:</strong> Pomenovanie obrázkov</p>
                    <p><strong>Meno žiaka:</strong> ${name}</p>
                    <p><strong>Hodnotenie:</strong> ${score} / ${total} (${perc}%)</p>
                    <p><strong>Dátum a čas:</strong> ${time}</p>
                    
                    <table>
                        <thead>
                            <tr>
                                <th>Pojem</th>
                                <th style="text-align:center">Stav odpovede</th>
                                <th style="text-align:center">Správnosť</th>
                            </tr>
                        </thead>
                        <tbody>
                            ${rows}
                        </tbody>
                    </table>

                    <div class="legend">
                        <strong>Legenda:</strong><br>
                        <span style="color:green">&#10004;</span> = Správne priradené miesto (kliknutie bolo v tolerancii)<br>
                        <span style="color:red">&#10008;</span> = Nesprávne miesto alebo neoznačené
                    </div>

                    <div class="no-print" style="margin-top:30px; text-align:center">
                        <button onclick="window.print()" style="padding:10px 20px; font-size:16px; cursor:pointer;">🖨 Vytlačiť (Ctrl + P)</button>
                    </div>
                </body>
                </html>
            `);
        }

        window.onload = init;
    </script>
</body>
</html>
